type CountryEnum struct {
	EnumerationName string
	EntityName      string
	EntityCode      string
	Deleted         string
}

func (e CountryEnum) Property(name string) string {
	switch name {
	default:
		return ""
	case "Enumeration Name":
		return e.EnumerationName
	case "Entity Name":
		return e.EntityName
	case "Entity Code":
		return e.EntityCode
	case "Deleted":
		return e.Deleted
	}
}

func (e CountryEnum) String() string {
	return e.EntityName
}

